import { useState, useEffect } from 'react';
import { Grid, Card, CardContent, CardMedia, Box } from '@mui/material';
import BusinessIcon from '@mui/icons-material/Business';
import CategoryIcon from '@mui/icons-material/Category';
import SecurityIcon from '@mui/icons-material/Security';
import ChatIcon from '@mui/icons-material/Chat';

import { Typography, Button } from '../../components/atoms';
import { getEmpresasApi } from '../../api/empresas';

const features = [
  {
    icon: <BusinessIcon sx={{ fontSize: 60, color: 'primary.main' }} />,
    title: 'Gestión de Empresas',
    description: 'Administra empresas con NIT, nombre, dirección y teléfono.',
  },
  {
    icon: <CategoryIcon sx={{ fontSize: 60, color: 'secondary.main' }} />,
    title: 'Catálogo de Productos',
    description: 'Productos con precios en múltiples monedas.',
  },
  {
    icon: <SecurityIcon sx={{ fontSize: 60, color: 'success.main' }} />,
    title: 'Blockchain',
    description: 'Verificación de integridad con tecnología blockchain.',
  },
  {
    icon: <ChatIcon sx={{ fontSize: 60, color: 'info.main' }} />,
    title: 'Chatbot IA',
    description: 'Asistente virtual inteligente para consultas.',
  },
];

export function Home() {
  const [empresas, setEmpresas] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadEmpresas();
  }, []);

  const loadEmpresas = async () => {
    try {
      const data = await getEmpresasApi();
      setEmpresas(data);
    } catch (error) {
      console.error('Error cargando empresas:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box>
      {/* Hero Section */}
      <Box
        sx={{
          textAlign: 'center',
          py: 6,
          px: 2,
          bgcolor: 'primary.main',
          color: 'white',
          borderRadius: 2,
          mb: 4,
        }}
      >
        <Typography variant="h2" gutterBottom>
          Lite Thinking
        </Typography>
        <Typography variant="h5" sx={{ mb: 3, opacity: 0.9 }}>
          Sistema de Gestión Empresarial
        </Typography>
        <Typography variant="body1" sx={{ mb: 4, maxWidth: 600, mx: 'auto' }}>
          Plataforma integral para la gestión de empresas, productos e inventario
          con tecnología de punta: IA y Blockchain.
        </Typography>
        <Button variant="contained" color="secondary" size="large" href="/login">
          Comenzar Ahora
        </Button>
      </Box>

      {/* Features */}
      <Typography variant="h4" align="center" gutterBottom sx={{ mb: 4 }}>
        Características Principales
      </Typography>
      <Grid container spacing={3} sx={{ mb: 6 }}>
        {features.map((feature, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <Card sx={{ height: '100%', textAlign: 'center', p: 2 }}>
              <Box sx={{ mb: 2 }}>{feature.icon}</Box>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  {feature.title}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  {feature.description}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* Empresas Preview */}
      <Typography variant="h4" align="center" gutterBottom sx={{ mb: 4 }}>
        Empresas Registradas
      </Typography>
      <Grid container spacing={3}>
        {empresas.slice(0, 6).map((empresa) => (
          <Grid item xs={12} sm={6} md={4} key={empresa.nit}>
            <Card>
              <CardContent>
                <Typography variant="h6">{empresa.nombre}</Typography>
                <Typography variant="body2" color="textSecondary">
                  NIT: {empresa.nit}
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  Tel: {empresa.telefono}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
}
